import React from 'react';

const Home = () => {
    return (
        <section id="home" className="section">
            <div className="container">
                <h1>Darsh Gangakhedkar</h1>
                <h2>ML & AI Engineer</h2>
                <p>Building intelligent solutions for tomorrow's challenges</p>
            </div>
        </section>
    );
};

export default Home;
